DROP SCHEMA IF EXISTS SenateVotes;

CREATE SCHEMA SenateVotes;
USE SenateVotes;

CREATE TABLE senator
  (id          VARCHAR(5),
   lastname    VARCHAR(30),
   firstname   VARCHAR(20),
   party       CHAR,
   state       CHAR(2),
   PRIMARY KEY (id)
  );

CREATE TABLE vote
  (congress  INT(3),
   session   INT(1),
   year      INT(4),
   number    INT(4),
   date      DATE,
   PRIMARY KEY (congress, session, number)
  );

CREATE TABLE voted
  (congress  INT(3),
   session   INT(1),
   number    INT(4),
   sen_id    VARCHAR(5),
   vote      CHAR,
   FOREIGN KEY (congress, session, number) REFERENCES vote (congress, session, number),
   FOREIGN KEY (sen_id) REFERENCES senator (id),
   PRIMARY KEY (congress, session, number, sen_id)
  );

